import React from "react";
import './Logo.scss'
import { Parallax } from 'react-scroll-parallax'

function Logo(){
    return(
        <div>
            <Parallax
                y={[0,100]}
                className="Background"
            >
                text
            </Parallax>
        </div>
    );
}

export default Logo;
